import React, { useState, useEffect } from 'react';

// Sample data of 20 workers
const initialWorkers = [
  { id: 1, name: "Alice Johnson", location: "New York, NY", experience: 5, rating: 4.7, available: true },
  { id: 2, name: "Michael Smith", location: "Los Angeles, CA", experience: 3, rating: 4.2, available: true },
  { id: 3, name: "Jessica Lee", location: "Chicago, IL", experience: 7, rating: 4.9, available: true },
  { id: 4, name: "David Brown", location: "Houston, TX", experience: 2, rating: 3.8, available: true },
  { id: 5, name: "Sophia Davis", location: "Phoenix, AZ", experience: 6, rating: 4.5, available: true },
  { id: 6, name: "James Wilson", location: "Philadelphia, PA", experience: 4, rating: 4.0, available: true },
  { id: 7, name: "Emma Martinez", location: "San Antonio, TX", experience: 8, rating: 4.8, available: true },
  { id: 8, name: "Benjamin Garcia", location: "San Diego, CA", experience: 1, rating: 3.5, available: true },
  { id: 9, name: "Olivia Rodriguez", location: "Dallas, TX", experience: 5, rating: 4.6, available: true },
  { id: 10, name: "William Hernandez", location: "San Jose, CA", experience: 3, rating: 4.1, available: true },
  { id: 11, name: "Ava Moore", location: "Austin, TX", experience: 9, rating: 4.9, available: true },
  { id: 12, name: "Ethan Taylor", location: "Jacksonville, FL", experience: 7, rating: 4.4, available: true },
  { id: 13, name: "Mia Anderson", location: "Fort Worth, TX", experience: 4, rating: 4.3, available: true },
  { id: 14, name: "Alexander Thomas", location: "Columbus, OH", experience: 2, rating: 3.9, available: true },
  { id: 15, name: "Isabella Jackson", location: "Charlotte, NC", experience: 6, rating: 4.7, available: true },
  { id: 16, name: "Daniel White", location: "San Francisco, CA", experience: 5, rating: 4.2, available: true },
  { id: 17, name: "Charlotte Harris", location: "Indianapolis, IN", experience: 3, rating: 4.0, available: true },
  { id: 18, name: "Matthew Martin", location: "Seattle, WA", experience: 7, rating: 4.5, available: true },
  { id: 19, name: "Amelia Thompson", location: "Denver, CO", experience: 8, rating: 4.8, available: true },
  { id: 20, name: "Joseph Garcia", location: "Washington, DC", experience: 6, rating: 4.6, available: true },
];

export default function Services() {
  const [workers, setWorkers] = useState(initialWorkers);

  // Handler for booking a worker
  const bookWorker = (id) => {
    setWorkers((prevWorkers) =>
      prevWorkers.map((w) => {
        if (w.id === id && w.available) {
          return { ...w, available: false };
        }
        return w;
      })
    );

    // Set timer to reset availability after 5 minutes (300000 ms)
    setTimeout(() => {
      setWorkers((prevWorkers) =>
        prevWorkers.map((w) => {
          if (w.id === id) {
            return { ...w, available: true };
          }
          return w;
        })
      );
    }, 300000); // 5 minutes
  };

  return (
    <div style={{ padding: '20px',textAlign:'' }}>
      <h1>Services - Blue Collar Workers</h1>
      <div
        style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(auto-fill,minmax(250px,1fr))',
          gap: '20px',
        }}
      >
        {workers.map((worker) => (
          <div
            key={worker.id}
            style={{
              border: '1px solid #ccc',
              borderRadius: '8px',
              padding: '15px',
              boxShadow: '0 2px 5px rgba(0,0,0,0.1)',
            }}
          >
            <h3>{worker.name}</h3>
            <p><strong>Location:</strong> {worker.location}</p>
            <p><strong>Experience:</strong> {worker.experience}</p>
            <p>
              <strong>Status:</strong>{' '}
              {worker.available ? (
                <span style={{ color: 'green' }}>Available</span>
              ) : (
                <span style={{ color: 'red' }}>Unavailable</span>
              )}
            </p>
            <button
              onClick={() => bookWorker(worker.id)}
              disabled={!worker.available}
              style={{
                backgroundColor: worker.available ? '#007bff' : '#ccc',
                color: 'white',
                border: 'none',
                padding: '10px 15px',
                borderRadius: '5px',
                cursor: worker.available ? 'pointer' : 'not-allowed',
              }}
            >
              {worker.available ? 'Book Now' : 'Booked'}
            </button>
          </div>
        ))}
      </div>
    </div>
  );
}
